import React from "react";

const Recipe = ({
  title,
  calories,
  image,
  ingredients,
  ingredientLines,
  source,
}) => {
  return (
    <li class="cards_item">
      <div class="card">
        <div class="card_image">
          <img src={image} alt="" />
        </div>
        <div class="card_content">
          <h2 class="card_title">{title}</h2>
          <div class="card_text">
            <p>{calories.toFixed(0)} calories</p>
            <p> {ingredients.length}ingredients</p>
            </div>
        </div>
      </div>
    </li>
  );
};

export default Recipe;
